import React, { Component } from "react";
import Mobilephone from "./Mobilephone";

class Mobile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      mabile: [
        {
          name: "",
          price: "",
          imgurl: "",
        },
      ],
    };
  }
  render() {
    return;
    <>
      <Mobilephone mobile={this.state.mabile} />
    </>;
  }
}

export default Mobile;
